import { useEffect, useState } from "react";
import PostCard from "./PostCard";

const Post = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch("https://strangers-things.herokuapp.com/api/2204-FTB-MT-WEB-PT/posts")
      .then((response) => response.json())
      .then((response) => setData(response.data.posts))
      .catch(console.error);
  }, []);
  console.log(data);
  return (
    <div>
      {data.map((post) => {
        return <PostCard {...post} key={post._id} />;
      })}
    </div>
  );
};
export default Post;
